import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100vw;
  height: 200px;
  background-image: url(/TopBanner.jpg);
  background-size: cover;
  background-position: center;
`;

function Galerie() {
    return <Container />;
};

export default Galerie;
